

def subline_processor(table:list):
    """
    Merges sublines with lines

    :param table: result of cropped_img_processor
    :type table: list
    :return: new_table - table with merged subline
    :rtype: list
    """
    new_table = list()
    for line_counter in range(len(table)):
        new_row = list()
        delete_list = list()
        for cell_counter in range(len(table[line_counter])):
            if table[line_counter][cell_counter]['is_subline'] == False:
                new_row.append(table[line_counter][cell_counter])
            else:
                for prev_cell_counter in range(len(new_table[-1])):
                    if new_table[-1][prev_cell_counter]['x_topleft'] - 15 < table[line_counter][cell_counter]['x_topleft'] \
                            < new_table[-1][prev_cell_counter]['x_topleft'] + new_table[-1][prev_cell_counter]['width']:
                        table[line_counter][cell_counter]['text'] = new_table[-1][prev_cell_counter]['text'].strip() + " " + table[line_counter][cell_counter]['text'].strip()
                        table[line_counter][cell_counter]['is_subline'] = False
                        table[line_counter][cell_counter]['y_topleft'] = new_table[-1][prev_cell_counter]['y_topleft']
                        table[line_counter][cell_counter]['row_num'] = new_table[-1][prev_cell_counter]['row_num']
                        delete_list.append(new_table[-1][prev_cell_counter])
                        new_table[-1].append(table[line_counter][cell_counter])
                        pass
        if new_table and delete_list:
            for cell in new_table[-1]:
                if cell in delete_list:
                    new_table[-1].remove(cell)
                    new_table[-1] = sorted(new_table[-1], key=lambda x: x['x_topleft'])
        if new_row:
            new_row = sorted(new_row, key=lambda x: x['x_topleft'])
            new_table.append(new_row)

    return new_table


def json_builder(table):
    """
    Builds final json-like output

    :param table: result of cropped_img_processor
    :type table: list
    :return: json_result
    :rtype: dict
    """
    header_control = True
    pre_table_control = True
    post_table_control = False
    json_result = dict()
    json_result['table_headers'] = list()
    json_result['table_data'] = list()
    json_result['pre_table_data'] = list()
    json_result['post_table_data'] = list()
    for row in table:
        json_row = list()
        if len(row) > 3:
            if header_control:
                for cell in row:
                    json_result['table_headers'].append(cell['text'])
                header_control = False
                pre_table_control = False
                post_table_control = True
            else:
                for cell in row:
                    json_row.append(cell['text'])

            if json_row:
                json_result['table_data'].append(json_row)
        else:
            if pre_table_control:
                for cell in row:
                    json_result['pre_table_data'].append(cell['text'])

            if post_table_control:
                for cell in row:
                    json_result['post_table_data'].append(cell['text'])

    return json_result

